Object.prototype.forEach=function(a){Object.keys(this).forEach(b=>a(this[b],b))},Object.prototype.map=function(a){const b={};return Object.keys(this).forEach(c=>b[c]=a(this[c],c)),b},Object.prototype.some=function(a){Object.keys(this).some(b=>a(this[b],b))},String.prototype.replaceAll=function(a,b){return this.replace(new RegExp(a,"g"),b)},String.prototype.forEach=function(a){this.split("").forEach((b,c)=>a(b,c))},String.prototype.map=function(a){return this.split("").map((b,c)=>a(b,c)).join("")},String.prototype.some=function(a){this.split("").some((b,c)=>a(b,c))};